function progressHandlingFunction(n){if(n.lengthComputable){var t=Math.round(n.loaded*100/n.total);$("#FileProgress").css("width",t+"%").attr("aria-valuenow",t);$("#FileProgress span").text(t+"%")}else $("#FileProgress span").text("unable to compute")}function completeHandler(){$("#createView").empty();$(".CreateLink").show();$.unblockUI()}function successHandler(n){n.statusCode==200?n.typeDoc=="PPT"?($("#docPPT").html(n.html),$().toastmessage("showSuccessToast","Présentation Uploadé avec succès")):n.typeDoc=="VIDEO"?($("#docVideo").html(n.html),$().toastmessage("showSuccessToast","Vidéo Uploadé avec succès")):n.typeDoc=="RESSOURCE"?($("#docRessource").html(n.html),$().toastmessage("showSuccessToast","Ressource Uploadé avec succès")):n.typeDoc=="i"?$().toastmessage("showSuccessToast","Image(s) Uploadé avec succès"):n.typeDoc=="a"&&$().toastmessage("showSuccessToast","Partial Uploadé avec succès"):$().toastmessage("showWarningToast","Erreur !!")}function errorHandler(n,t,i){alert("There was an error attempting to upload the file. ("+i+")")}function OnDeleteAttachmentSuccess(n){n.ID&&n.ID!=""?$("#Attachment_"+n.ID).fadeOut("slow"):(alter("Unable to Delete"),console.log(n.message))}function Cancel_btn_handler(){$("#createView").empty();$(".CreateLink").show();$.unblockUI()}